import React from 'react'
import HomePage from "./pages/Home/HomePage";
import DashboardPage from "./pages/Dashboard/DashboardPage";

const routes = [
    {
        path: '/',
        exact: true,
        main: () => <HomePage/>
    },
    {
        path: '/dashboard',
        exact: true,
        main: () => <DashboardPage/>
    }
];

export default routes;
